import React, {Fragment} from 'react'
import {NavLink} from 'react-router-dom'

export const Navbar = () => {
    return (
        <nav className="nav nav-pills nav-fill flex-column">
            <div className="navbar-brand">Microblog</div>
            <NavLink className="nav-item nav-link" to="/" exact>Active</NavLink>
            <NavLink className="nav-item nav-link" to="/about">Link</NavLink>
         </nav>
    )
}
